import React, { Component } from 'react';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';
import Slider from '@material-ui/core/Slider';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import './control.css';
import axios from 'axios'
import PinchZoomPan from 'react-responsive-pinch-zoom-pan';
import jwt_decode from 'jwt-decode'
import { decode } from 'punycode';
import wing1 from './third/wing-1.jpg'
import firstfloor from './first/1.jpg'

import Modal from './Modal';



let imageview;
var resetbut
class Control extends Component {
    constructor(props) {
        super(props);

        this.state = {
            first_name: '',
            last_name: '',
            email: '',
            position: '',
            floor: '',
            lab: '',
            isOn: "off",
            tempvalue:20,
            ac:-1,
            select:0,
            print:'',
            isShowing: false,
            isOpen:false
        };
        this.onSubmit=this.onSubmit.bind(this)
        this.setTemp=this.setTemp.bind(this)
        this.ac=this.ac.bind(this)
        this.wing=this.wing.bind(this)
        this.reset=this.reset.bind(this)

    }

    setTemp=(event,value)=>{this.setState({tempvalue:value})}


    setOn = (event) => {
        this.setState({ isOn: event.target.value });
    }

    // openModalHandler = () => {
    //     console.log("SHIT")
    //     this.setState({
    //         isShowing: true
    //     });
    // }

    // closeModalHandler = () => {
    //     this.setState({
    //         isShowing: false
    //     });
    // }
    toggleModal = () => {
        this.setState({
          isOpen: !this.state.isOpen
        });
        console.log(this.state.isOpen)
      }



    componentDidMount() {
        // this.interval = setInterval(() => this.render), 2000);
        // this.interval = setInterval(() => this.setState({print:imageview}), 1000);
        const token = localStorage.usertoken
        const decoded = jwt_decode(token)
        console.log(decoded)
        this.setState({
          first_name: decoded.first_name,
          last_name: decoded.last_name,
          email: decoded.email,
          position: decoded.position,
          floor: decoded.floor,
          lab: decoded.lab
        })
      }
      componentWillUnmount() {
        clearInterval(this.interval);
      }
    ac(e){
        console.log("FUCK")
        this.setState({ac:e})
        // this.openModalHandler()
        this.toggleModal() 


    }

    wing(e){


        this.setState({select:e})


    }
    onSubmit(e)
    {

        if(this.state.isOn=="on"){
        let info1={
            no:this.state.ac
        }
        console.log(info1)
        axios.post('http://localhost:5000/control/on',info1)
        .then(res=>
            {
                console.log(this.state.tempvalue)

            })

        let info2={
            temp:this.state.tempvalue,
            no:this.state.ac
        }
        console.log(info2)
        axios.post('http://localhost:5000/control/change',info2)
        .then(res=>
            console.log(''))

        }
        else if(this.state.isOn=="off"){
            let info1={
                no:this.state.ac
            }
        console.log(info1)

            axios.post('http://localhost:5000/control/off',info1)
                .then(res=>
                    console.log('hello')
                    )
            }

    }

    reset(event)
    {
        this.setState({select:0})
    }
    render() {

        if(this.state.floor=='3')
        {

            if(this.state.select==0 )
            {
                imageview=''

                imageview=
                <div>
                <img src={require(('./third/3.jpg'))} alt="resposnive imgage with clickable areas" width="800" height="500" className="aligncenter size-full wp-image-3344" useMap="#3image-map" />
                <map name="3image-map">
                <area target="_blank"  alt="WING-IV" title="WING-IV"  coords="12,11,404,242" shape="rect" onClick={()=>this.wing(4)}/>
                <area   target="_blank" alt="WING-III" title="WING-III" coords="432,9,781,240" shape="rect" onClick={()=>this.wing(3)}/>
                <area  target="_blank" alt="WING-II" title="WING-II"  coords="437,261,784,496" shape="rect" onClick={()=>this.wing(2)}/>
                <area   target="_blank"   alt="WING-I" title="WING-I"  coords="8,260,404,494" shape="rect" onClick={()=>this.wing(1)}/>
                </map>
                </div>

            }
            else if(this.state.select==1)
            {

                imageview=
                <div>
